import React, { useState } from 'react';

const DataEntryForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    week: 'week 1',
    school: '',
    staffName: 'staff 1',
    competenciesMet: '',
  });

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Check if required fields are empty
      if (!formData.name || !formData.week || !formData.school || !formData.staffName || !formData.competenciesMet) {
        console.error('All fields are required');
        return;
      }

      const response = await fetch('/api/entries', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      const result = await response.json();
      console.log(result);
    } catch (error) {
      console.error('Error submitting data:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="name">Name:</label>
      <input
        type="text"
        id="name"
        name="name"
        value={formData.name}
        onChange={(e) => setFormData({ ...formData, name: e.target.value })}
      />

      <label htmlFor="week">Week:</label>
      <select
        id="week"
        name="week"
        value={formData.week}
        onChange={(e) => setFormData({ ...formData, week: e.target.value })}
      >
        <option value="week 1">Week 1</option>
        <option value="week 2">Week 2</option>
        <option value="week 3">Week 3</option>
        <option value="week 4">Week 4</option>
        <option value="week 5">Week 5</option>
        <option value="week 6">Week 6</option>
        <option value="week 7">Week 7</option>
        <option value="week 8">Week 8</option>
        <option value="week 9">Week 9</option>
        <option value="week 10">Week 10</option>

      </select>

      <label htmlFor="school">School:</label>
      <input
        type="text"
        id="school"
        name="school"
        value={formData.school}
        onChange={(e) => setFormData({ ...formData, school: e.target.value })}
      />

      <label htmlFor="staffName">Staff Name:</label>
      <select
        id="staffName"
        name="staffName"
        value={formData.staffName}
        onChange={(e) => setFormData({ ...formData, staffName: e.target.value })}
      >
        <option value="staff 1">Staff 1</option>
        <option value="staff 2">Staff 2</option>
        <option value="staff 3">Staff 3</option>
        <option value="staff 4">Staff 4</option>
        <option value="staff 5">Staff 5</option>
        <option value="staff 6">Staff 6</option>
        <option value="staff 7">Staff 7</option>
        <option value="staff 8">Staff 8</option>

      </select>

      <label htmlFor="competenciesMet">Competencies Met:</label>
      <textarea
        id="competenciesMet"
        name="competenciesMet"
        value={formData.competenciesMet}
        onChange={(e) => setFormData({ ...formData, competenciesMet: e.target.value })}
      />

      <button type="submit">Submit</button>
    </form>
  );
};

export default DataEntryForm;
